// SPDX-License-Identifier: GPL-3.0-or-later

pragma solidity >=0.5.0;

import './SafeERC20Namer.sol';

// produces names for pairs of tokens using Pangolin's naming scheme
library PairNamer {
    string private constant TOKEN_SYMBOL_PREFIX = 'PNG:';
    string private constant TOKEN_SEPARATOR = ':';

    // produces a pair descriptor in the format of `${prefix}${name0}:${name1}${suffix}`
    function pairName(
        address token0,
        address token1,
        string memory prefix,
        string memory suffix
    ) internal view returns (string memory) {
        return
            string(
                abi.encodePacked(
                    prefix,
                    SafeERC20Namer.tokenName(token0),
                    TOKEN_SEPARATOR,
                    SafeERC20Namer.tokenName(token1),
                    suffix
                )
            );
    }

    // produces a pair symbol in the format of `PNG:${symbol0}:${symbol1}${suffix}`
    function pairSymbol(
        address token0,
        address token1,
        string memory suffix
    ) internal view returns (string memory) {
        return
            string(
                abi.encodePacked(
                    TOKEN_SYMBOL_PREFIX,
                    SafeERC20Namer.tokenSymbol(token0),
                    TOKEN_SEPARATOR,
                    SafeERC20Namer.tokenSymbol(token1),
                    suffix
                )
            );
    }
}

